import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { HomeComponent } from './home/home.component';
import { LoginComponent } from './login/login.component';
import { DashboardComponent } from './dashboard/dashboard.component';
import { CreateGroupComponent } from './create-group/create-group.component';
import { GroupComponent } from './group/group.component';
import { ViewMembersComponent } from './view-members/view-members.component';
import { AddExpenseComponent } from './add-expense/add-expense.component';
import { MyExpensesComponent } from './my-expenses/my-expenses.component';
import { OweExpenseComponent } from './owe-expense/owe-expense.component';
import { PaidExpenseComponent } from './paid-expense/paid-expense.component';
import { AllUsersComponent } from './all-users/all-users.component';
import { UpdateUserComponent } from './update-user/update-user.component';
import { UserGuard } from './guards/user.guard';

const routes: Routes = [
  {
    path: '',
    component: HomeComponent,
  },
  {
    path: 'login',
    component: LoginComponent,
  },
  { path: 'dashboard', component: DashboardComponent ,canActivate:[UserGuard]},
  { path: 'add new group', component: CreateGroupComponent,canActivate:[] },
  { path: 'myGroup', component: GroupComponent },
  { path: 'viewMember/:id', component: ViewMembersComponent },
  { path: 'addExpense/:groupId', component: AddExpenseComponent },
  { path: 'viewExpense/:groupId', component: MyExpensesComponent },
  { path: 'oweExpense/:expenseId', component: OweExpenseComponent },
  { path: 'paidExpense/:expenseId', component: PaidExpenseComponent },
  {path:'viewAllUsers',component:AllUsersComponent},
  {path:'updateUser/:id',component:UpdateUserComponent}
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule],
})
export class AppRoutingModule {}
